void Model::Run(){
 double lat,lon,angle,dist,newlat,newlon;
 bool ok;
 int x,y,i,j,k,s;
 
 if(verbose) DisplayStatus();
 
 randreset();
 
 for(int r=0;r<replicates;r++){
  
  
  memset(map,0,sizeof(int)*ROWS/4*COLS/4);  
   
  for(i=0; i<startpoints;i++){ //For each starting point
  
   memset(pathx,0,sizeof(pathx));
   memset(pathy,0,sizeof(pathy));
  
   // Simulate path and store it in pathx, pathy
   
   lat=startlat[i]/180*M_PI;
   lon=startlon[i]/180*M_PI;
   pathx[0]=startlon[i];
   pathy[0]=startlat[i];

   for(s=1;s<nsteps[i];s++){ //Move 's' steps
    ok=false;
    do{
     
     angle=uniform(-360,360)/180.0*M_PI;	 	// Get random angle
     if(mean>0) dist=normal(mean,sd)/6378130.0;	// Get random distance
     else dist=uniform(smin,smax)/6378130.0;  
     if(dist<0) dist=0;			 	// Check if it is positive
     
     //Compute new latitude and longitude
     
     newlat=asin(sin(lat)*cos(dist)+cos(lat)*sin(dist)*cos(angle));
     if(cos(lat)==0) newlon=lon; // endpoint a pole
     else newlon=fmod(lon-asin(sin(angle)*sin(dist)/cos(lat))+M_PI,2*M_PI)-M_PI;
     pathx[s]=newlon*180/M_PI;
     pathy[s]=newlat*180/M_PI;
     
     // Check if out of bounds
     
     if((xllcorner<pathx[s])&&((xllcorner+cols*cellsize)>pathx[s])
        &&(yllcorner<pathy[s])&&((yllcorner+rows*cellsize)>pathy[s])){

      // Check if inland

      x=(int)abs(ceil((xllcorner-pathx[s])/cellsize));
      y=(int)abs(ceil((yllcorner+rows*cellsize-pathy[s])/cellsize))-1;
     
      if((x>=0)&&(x<cols)&&(y>0)&&(y<rows)){
       if(mask[y][x]==0){ 
        ok=true;
        //cerr <<  pathx[s] << "\t" << pathy[s] << "\t" << x << "\t" << y << "\t" << mask[y][x] << "\t" << dist*6378130.0 << endl; 
        //cout <<  pathx[s] << "," << pathy[s] << endl; 
        lat=pathy[s]/180*M_PI;
        lon=pathx[s]/180*M_PI;
       }
      }  
      //else cerr << "outissimo" << endl;
     }   
     //else cerr << "out" << endl;
    }while(!ok);
   }
   // Now count number of positions in each 0.5 x 0.5 degree cell in the same geographic domain
   // bounded by xllcorner, yllcorner, xllcorner+cols*cellsize, yllcorner+cols*cellsize
  
   for(j=0;j<nsteps[i];j++){    
    x=(int)abs(ceil((xllcorner-pathx[j])/cellsize));
    y=(int)abs(ceil((yllcorner+rows*cellsize-pathy[j])/cellsize))-1;
    
    x=x/4;
    y=y/4;
    //cerr << x << "\t" << y << endl;
    if((x>=0)&&(x<(cols/4))&&(y>0)&&(y<(rows/4))) map[y][x]++;
   }  
  } 
  cout << "ncols " << cols/4 << endl;
  cout << "nrows " << rows/4 << endl;
  cout << "xllcorner " << xllcorner << endl;
  cout << "yllcorner " << yllcorner << endl;
  cout << "cellsize " << cellsize*4.0 << endl;
  cout << "NODATA_value 0" << endl;
  for(j=0;j<(rows/4);j++){
   for(k=0;k<(cols/4);k++) cout << map[j][k] << " ";
   cout << endl;
  } 
 }
}


